import logo from './logo.svg';
import React, {Component} from 'react';
//import './App.css';
import {AppBar, Toolbar} from "@material-ui/core"
import FilteredList from "./FilteredList";
import DellPhone from "./pomegranate.jpg";
import MDesktop from "./mango.jpg";
import ADesktop from "./Orange.jpg";
import STablet from "./kiwi.jpg";
import MTablet from "./rambuttan.jpg";
import APhone from "./raspberry.jpg";
import MPhone from "./apple.jpg";


const produce = [
  { name: "Pomegranate", size: "Medium", type: "berry", img: DellPhone, rating: 4, price: 10, icon:   <button class="btn"><div  style={{color: 'blue'}}>

      </div></button>},
  { name: "Orange", size: "Medium", type: "citrus", img: MDesktop, rating: 6, price: 10,icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Apple", size: "Small", type: "pome", img: ADesktop, rating: 4, price: 10,icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Kiwi", size: "Small", type: "berry", img: STablet, rating: 3, price: 10,icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Rasberry", size: "Small", type: "berry", img: MTablet, rating: 5, price: 10, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Rambutaan", size: "Small", type: "berry" ,img: APhone, rating: 2, price: 10, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Coconut", size: "Large", type: "drupe", img: MPhone, rating:7, price: 10, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Papaya", size: "Large", type: "berry", img: MPhone, rating:8, price: 10, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Mango", size: "Large", type: "drupe", img: MPhone,rating:9, price: 10, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Lime", size: "Small", type: "citrus", img: MPhone, rating:11, price: 10, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Fig", size: "Small" ,type: "berry", img: MPhone, rating:10, price: 10, icon:   <div style={{color: 'blue'}}>
      </div>},
  { name: "Peach", size: "Medium", type: "drupe", img: MPhone ,rating:1, price: 10, icon:   <div style={{color: 'blue'}}>

      </div>}
];

class App extends Component {
  render() {
    return (
      <div className="App">
      <h1 id ="title" > Fruit Stand</h1>
        <FilteredList items = {produce}/>
      </div>
    );
  }
}

export default App;
